import { getdataAction } from '../Redux/Action';
import { data } from './Url';

async function getdata(props) {

    try {
      const response = await axios.get(data);
      props(getdataAction( response.data))
    //   console.log(response.data)
      
      
    } catch (error) {
      console.error(error);
    }
  }
export {getdata}
